CREATE DEFINER=`root`@`localhost` FUNCTION `GetSumofSalary`() RETURNS int(11)
    DETERMINISTIC
begin
declare x int;
declare sumofsal int default 0;
declare y int;
declare sal int;
set x = (select min(emp_no) from employees);
set y = (select max(emp_no) from employees);
while x < y do
if (x mod 100) = 0 then
set sal = (select salary from employees where emp_no = x);
set sumofsal = sumofsal + sal;
set x = x + 100;
else
set x = x + 1;
end if;
end while;
return sumofsal;
end ;;
