CREATE DEFINER=`root`@`localhost` PROCEDURE `get_Emp_Name`()
begin
declare x varchar(40);
declare y int;
declare y1 int;
drop table if exists t_new;
create table t_new (c1 int,c2 varchar(40));
set y1 = (select max(emp_no) from employees);
set y = (select min(emp_no) from employees
where mod(emp_no,100) = 0);
while y <= y1 do
set x = (select first_name from employees
where emp_no = y);
insert into t_new select y,x;
set y = y + 100;
End while;
select * from t_new;
End ;;
